 solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"submitAnswerButton\":\"Submit\"},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"question\":\"<p>c. The above document represents a food conveyor belt in motion. What type of motion does it describe if the dishes move by 1 meter every 5 seconds?</p>\\n\"},\"library\":\"H5P.MultiChoice 1.16\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"Multiple Choice\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Multiple Choice\"},\"subContentId\":\"4e9bf8e1-3839-4b9e-8e7b-4dc86bad7a49\"}]},\"library\":\"H5P.QuestionSet 1.20\",\"metadata\":{\"contentType\":\"Question Set\",\"license\":\"U\",\"title\":\"Question Set\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Question Set\"},\"subContentId\":\"956fc167-7213-4703-acc6-ff4b93a32dfe\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"taskDescription\":\"<p>2. Drag the terms into their corresponding slots.</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"dropZoneIndex\":\"Drop Zone @index.\",\"empty\":\"Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\
